import React from 'react';
import {TITLE} from './ProductComponent/products';

class Company extends React.Component {
  render() {
    return(
      <React.StrictMode>
        <TITLE>Company</TITLE>
      <dl>
        <dt>社名</dt>
        <dd></dd>
        <dt>住所</dt>
        <dd></dd>
        <dt>設立</dt>
        <dd></dd>
        <dt>資本金</dt>
        <dd></dd>
        <dt>従業員数</dt>
        <dd></dd>
        <dt>事業内容</dt>
        <dd></dd>
      </dl>
      </React.StrictMode>
    );
  }
}

export default Company;
